import React from 'react';
import './PlayerCard.css';
const PlayerCard = (props) => {
    const {img}=props.player /**object distructure */
    return (
        <div className="p-2">
            <div className="card mb-3 border-danger" style={{maxWidth:"740px"}}>
                <div className="row g-0">
                    <div className="col-md-4 px-5  py-3">
                        <img className="p-2 border rounded border-success" src={img} alt=""/>
                    </div>
                    <div className="col-md-8">
                        <div className="card-body">
                            <h5 className="card-title">dfgdf</h5>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default PlayerCard;
